import React from "react";
import Button from "../Button";
import oneStopFlight from "../../images/onestop.png";
import TicketList from "../TicketList/TicketList";
import DirectionRoute from "../../pages/DirectionRoute";
import s from "./Tickets.module.scss";

function Tickets({
//   id,
  logoUrl,
  response,
  marketingCarrier,
  departure,
  origin,
  durationInMinutes,
  destination,
  price = "",
}) {
  // console.log({response});

  return (
    <>

      <div className={s.ticket}>
        <div className={s.imageLogo}>
                <img src={logoUrl} alt="air_astana" className={s.airAstanaLogo} />
                <p className={s.imageInnerText}> {companyName}</p>
                </div>
        <div className={s.departure}>
          <h2 className={s.departureTime}>{response}</h2>
          <h6>{origin}</h6>
        </div>
        <div className={s.stops}>
          <p>{durationInMinutes}</p>
          <img src={oneStopFlight} alt="one_stop" className={s.oneStop} />
        </div>
        <div className={s.arrival}>
          {/* <h2 className={s.arrivalTime}>{arrival}</h2> */}
          <h6>{destination}</h6>
        </div>
        <h6 className={s.price}>{price}</h6>
        <Button className={s.selectButtons}>Select</Button>
      </div>
    </>
  );
}
export default Tickets;
